import React from 'react';
import {BrowserRouter,Route} from 'react-router-dom';



const PageOne = () =>{
    return <div>PageOne</div>
}


const PageTwo = () =>{
    return <div>PageTwo

        <button>Click</button>
    </div>
}



const App = () => {
    return ( <div>
        
        App
        <div>
        <BrowserRouter> 
            <Route path = "/" exact component={PageOne}/> 
            <Route path = "/pagetwo"   component={PageTwo}/>
        </BrowserRouter>
        </div>
        
         
        </div> );
}

export default App;
